bool IconGen_FindByID(int16_t id, IconFamily* out) {

    for (int i=0;i<gIconGenCount;i++){ if (gIconGenTable[i].id==id){ if (out) *out=*gIconGenTable[i].fam; return true; } }

    return false;
}
